import React, { Component } from 'react';
import { Router, Route, Link, Switch } from 'react-router-dom';
import './App.css';
import topicsButton from './hashtag.png';
import Articles from './components/Articles.jsx';

class App extends Component {
  render() {
    return (
      <div className="App">
        {/* This is the top bar div */}
        <div id="topBar">
          <Link to="/">
            <img
              id="logo"
              src="https://northcoders.com/images/logos/learn_to_code_manchester_original_second.png"
              alt="NC Logo"
            />
          </Link>

          <Link to="/articles">
            <img
              className="topButton"
              src="https://assets.dryicons.com/uploads/icon/svg/6245/ffc1fdf3-d5b6-46cb-9a1b-4c6ec1c0b46e.svg"
              alt="articlesButton"
            />
          </Link>
          <Link to="/topics">
            {' '}
            <img
              className="topButton"
              src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQisd_j8tMZJcHJOIpYHaSpxVXlsx5mKYn5P5TdycCJbJk7a86_2w"
              alt="topicsButton"
            />
          </Link>
          <Link to="/users">
            <img
              className="topButton"
              src="https://cdn4.iconfinder.com/data/icons/small-n-flat/24/user-group-512.png"
              alt="usersButton"
            />
          </Link>
        </div>
        {/* This is the main div */}
        <div id="mainDiv">
          <div id="displayDiv">
            <Route path="/articles" component={Articles} />
          </div>
        </div>
      </div>
    );
  }
}

export default App;
